import React from 'react';
// import Table from '../Teble';

import PrvnTable from '../../component2/PrvnTable';
import { EditOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import translator from '../../Translator/translator';


function Countries(props) {

    const columns = [{
        title: 'nameLocal',
        dataIndex: 'localName',
        key: '1',
    },
    {
        title: 'otherName',
        dataIndex: 'otherName',
        key: '2',
    },
    {
        title: 'enName',
        dataIndex: 'enName',
        key: '3',
    },
    {
        title: 'createTime',
        dataIndex: 'createTime',
        key: '4',
    },
    {
        title: translator('Action'),
        key: 'action',
        render: (text, record) => (
            <Link
                to={{
                    pathname: `/countries/${record.id}/edit`,
                    state: { id: record.id }
                }}
            >
                <EditOutlined style={{ fontSize: '20px' }} />
            </Link>
        ),
    },
    {
        title: 'deleted',
        dataIndex: 'deleted',
        key: 'deleted',
        render: (text, record) => {
            return <>
                { text ?
                    <PrvnTag className="prvn-tag-hover-disable"> vided </PrvnTag>
                    : <DeleteModal record={record} type={props.type} />}
            </>
        }
    },
    ]
    const dataSource = [
        {
            "id": 3,
            "createTime": "2021-03-08T07:04:59Z",
            "updateTime": "2021-03-08T07:04:59Z",
            "localName": "امارات متحده عربی",
            "enName": "United Arab Emirates",
            "shortCode": "AE",
            "otherName": null,
        },
        {
            "id": 2,
            "createTime": "2021-03-08T07:04:59Z",
            "updateTime": "2021-03-08T07:04:59Z",
            "localName": "امارات متحده عربی2",
            "enName": "United Arab Emirates2",
            "shortCode": "AE2",
            "otherName": null
        }, {
            "id": 3,
            "createTime": "2021-03-08T07:04:59Z3",
            "updateTime": "2021-03-08T07:04:59Z3",
            "localName": "امارات متحده عربی3",
            "enName": "United Arab Emirates3",
            "shortCode": "AE3",
            "otherName": null
        }, {
            "id": 4,
            "createTime": "2021-03-08T07:04:59Z4",
            "updateTime": "2021-03-08T07:04:59Z4",
            "localName": "امارات متحده عربی4",
            "enName": "United Arab Emirates4",
            "shortCode": "AE4",
            "otherName": null
        }
    ]

    return (
        <div>
            <PrvnTable
                dataSource={dataSource}
                columns={columns}
                pagination={false}
            >
            </PrvnTable>
        </div>
    );
}

export default Countries;
